import React from 'react';

interface SimpleCompanyResultsProps {
  results: any;
}

const SimpleCompanyResults = ({ results }: SimpleCompanyResultsProps) => {
  console.log('SimpleCompanyResults props:', results);
  
  if (!results) {
    return <div>No results prop provided</div>;
  }

  return (
    <div style={{ border: '2px solid red', padding: '20px', margin: '20px' }}>
      <h2>DEBUG: Company Search Results</h2>
      <div>
        <strong>Company Name:</strong> {results.company_name || 'N/A'}
      </div>
      <div>
        <strong>Found:</strong> {String(results.found)}
      </div>
      <div>
        <strong>Total Matches:</strong> {results.total_matches || 0}
      </div>
      <div>
        <strong>Tables Searched:</strong> {results.tables_searched || 0}
      </div>
      <div>
        <strong>Results by Table Length:</strong> {results.results_by_table ? results.results_by_table.length : 'N/A'}
      </div>
      
      <h3>Raw Data:</h3>
      <pre style={{ background: '#f0f0f0', padding: '10px', fontSize: '12px' }}>
        {JSON.stringify(results, null, 2)}
      </pre>
    </div>
  );
};

export default SimpleCompanyResults;
